import { HeaderComponent } from "./Header.styles" 
import CodImg from "../../assets/images/Call_of_Duty_Warzone_Logo.png";

export function Header(){
    return(
        <HeaderComponent>
                <div>
                    <img src={CodImg}/>
                    <h1>Wz Loadouts</h1>
                </div>
        </HeaderComponent>
    )
}
